import React from "react";
import Navbar from "../resources/components/Navbar";
import { Card } from "@mui/material";

const Jobs = () => {
  return (
    <>
      <Navbar />
      <div className="page-title">Available Jobs</div>
      <div className="page-content">
        <div className="job-cards">
          <Card />
          <Card />
          <Card />
          <Card />
          <Card />
          <Card />
        </div>
      </div>
    </>
  );
};

export default Jobs;
